// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

contract ArithmeticOperator {
    uint16 public x = 30;
    uint16 public y = 10;

    function add() public view returns (uint) {
        return x + y;
    }

    function sub() public view returns (uint) {
        return x - y;
    }

    function mul() public view returns (uint) {
        return x * y;
    }

    function div() public view returns (uint) {
        return x / y;
    }

    function modulo() public view returns (uint256) {
        return x % y;
    }

    function reducido() public view returns (uint256) {
        return x - 1;
    }

    function incrementado() public view returns (uint256) {
        return x + 1;
    }
}

